import { useContext } from "react";
import { ButtonsCheck } from "../../../shared/Buttons/ButtonsPrimary";
import { AuthContext } from "../../../shared/context/auth.context";
import { LoginComponent } from "./FormLogin.components";

export const FormLoginHtml = () => {
  const { context, setContext } = useContext(AuthContext);
  const { handleClick } = LoginComponent();
  console.log(context);
  return (
    <>
      <h1>Form Login Html</h1>
      <p>{context}</p>
      <button onClick={() => handleClick(setContext)}>Click me 2</button>
      <ButtonsCheck />
    </>
  );
};
